import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

import VideoGameList from "./VideoGameList";
import OrdersList from "./OrdersList";
import OrderItemsList from "./OrderItemList";

function Main() {
  const rootElement = document.getElementById("root");
  return (
    (
      <BrowserRouter>
        <Routes>
          <Route exact path="/videoGamesList" component={VideoGameList} />
          <Route path="/ordersList" component={OrdersList} />
          <Route path="/orderItemsList" component={OrderItemsList} />
        </Routes>
      </BrowserRouter>
    ),
    rootElement
  );
}
export default Main;
